import React from 'react';
import InputText from '../components/textInput';
import { Link,useHistory} from "react-router-dom";
import axios from 'axios'
import Button from '../components/button';
import Loading from "../images/loading.gif"

export var Reponse=""

function sendData(){
  
  let img=document.getElementById("loading")
  img.style.display='block'

  let div=document.getElementById("divF")
  div.style.display='none'


  /*axios.post('https://jsonplaceholder.typicode.com/posts',{'data':data})*/
  
  axios.post('http://127.0.0.1:5000/post',{'data':"data",
  headers: {'Access-Control-Allow-Origin' : '*'}})
  .then(response=>{
    setTimeout(function(){  //Beginning of code that should run AFTER the timeout
      Reponse=response.data
      let history=useHistory();
      history.push('/service1_1')
  },5000);
    
   
    /*console.log(response.data)
    console.log(response);*/
  })
  /*.then(() => this.setState({ redirect: true }))*/
  .catch(error=>{
    console.log(error);
  })
}

const Service1 = () => {
    return (
      <div id="divF"
      style={{
        display: 'flex',  justifyContent:'center', alignItems:'center', height: '100vh',flexDirection:'column'
      }}>
       
      <InputText value="">
      </InputText>
      <Button onClick={()=>sendData()} >Analyze</Button>
      <Link to="/service1_1" >
    </Link>
    <img  id="loading" style={{
      display: 'none',top:'50%',overflow:'hidden'
    }} src={Loading} alt="loading..." />
    <div>
      </div>
      <div >
    
    </div>
    </div>
    );
  };
  

  export default Service1;
